import { Outlet, Link } from "react-router-dom";

const Layout = () => {
    return  (
        <>
            <nav>
                <ul>
                    <li>
                        <Link to="/Disclaimer">Disclaimer</Link>
                    </li>
                    <li>
                        <Link to="/Developer">Developer?</Link>
                    </li>
                    <li>
                        <Link to="/Faq">Customer Service</Link>
                    </li>
                </ul>
            </nav>

            <Outlet />
        </>
    )
};

export default Layout;
